-- Sequence and defined type
CREATE SEQUENCE IF NOT EXISTS document_version_id_seq;

-- Table Definition
CREATE TABLE "public"."document_version" (
    "id" int4 NOT NULL DEFAULT nextval('document_version_id_seq'::regclass),
    "version_number" float8 NOT NULL,
    "doc_id" int4 NOT NULL,
    "delta" json NOT NULL,
    "created_at" timestamp DEFAULT CURRENT_TIMESTAMP,
    "updated_by" int4,
    "updated_at" timestamp,
    "created_by" int4,
    PRIMARY KEY ("id")
);

